import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App left">
        <form>
          <h2>Add Activity</h2>
          <label>Title: </label><br></br>
          <input className="title" type="text" value={null}></input><br></br>

          <label>Description: </label><br></br>
          <input className="desc" type="text" value={null}></input><br></br>

          <label>Date: </label><br></br>
          <input className="date" type="text" value={null}></input><br></br>

          <br></br>

          <button className="submit" type="submit">Add Activity</button>
        </form>
      </div>

      <div className="App right">
        <h2>My Activity List</h2>

      </div>
    </div>
  );
}

export default App;
